      };

  return (
    <div className="pb-20 pt-5 px-10 md:px-20 lg:px-40 ">
      <div className="p-6 bg-blue-200 content-center rounded-lg hover:shadow-2xl">
        <h2 className="text-2xl pb-2">Meet Our Visionaries</h2>
